export default function ConsultoriaHospitalar() {
    return (
      <div className="p-10">
        <h1 className="text-3xl font-bold mb-4">Consultoria Hospitalar</h1>
        <p>
          Aqui você pode detalhar como a MA Tecnologia ajuda hospitais com otimização de processos, treinamento, etc.
        </p>
      </div>
    );
  }
